package main

import (
	"fmt"
	"strings"
)

func main() {
	s := ""
	t := ""
	fmt.Printf("Output: %v\n", string(findTheDifference(s, t)))
	// fmt.Println(string(byte(97)), rune('z'))
}

func findTheDifference(s string, t string) byte {
	for i := 97; i < 123; i++ {
		if strings.Count(s, string(byte(i))) != strings.Count(t, string(byte(i))) {
			return byte(i)
		}
	}
	return s[0]
}
